import React from 'react'
import Frame from '../img/candidates/img.png'

const candidates = [
    {"id": 1, "name": 'Konang Tygazayn'},
    {id: 2, name: 'Kadek Ninda'},
    {id: 3, name: 'Billy Fahd Qodama'}
];

const Calon = props => {
    return (
        <div>
            <img src={Frame}></img>
            <div className='title'>
                <h1>{props.candidate.id}</h1>
                <h2>{props.candidate.name}</h2>
            </div>
        </div>
    );
};

const List = () => {
    {candidates.map(({id, name}) => {
        return <Calon key={id} name={name}/>;
    })}
};


export default function Candid() {
  return (
    <div>
        <List/>
    </div>
  )
}
